import React, { useState, useEffect } from "react";
import ActorList from "../actorList";
import { getActors } from "../../api/tmdb-api"; // Assuming you have a function to fetch actors.

const ParentComponent = () => {
  const [actors, setActors] = useState([]);

  useEffect(() => {
    getActors()
      .then((data) => {
        console.log("Actors fetched:", data); // Log the actors data to check if it's being fetched correctly
        setActors(data); // Update the actors state
      })
      .catch((error) => {
        console.error("Error fetching actors:", error);
      });
  }, []);

  return <ActorList actors={actors} />;
};

export default ParentComponent;
